import React from 'react';
import { Link } from 'react-router-dom';
import { Settings, Share, LocalPhone, HeadsetMic } from '@material-ui/icons';

import { Container } from './styles';

export default function DeepMenu() {
  return (
    <Container>
      <ul>
        <li>
          <HeadsetMic />
        </li>
        <li>
          <LocalPhone />
        </li>
        <li>
          <Settings />
        </li>
        <li>
          <Share />
        </li>
      </ul>
    </Container>
  );
}
